import './App.css';
import DucksList from './pages/ducksList';


function App() {
  const [activeTab, setActiveTab] = useState('warehouse');

  return (
    <div className="App">

    <nav>
      <button onClick={() => setActiveTab('warehouse')}>
        Duck Warehouse
      </button>
      <button onClick={() => setActiveTab('store')}>
        Duck Store
      </button>
    </nav>

    {activeTab === 'warehouse' && (
        <DucksList mode="warehouse" />
      )}
      {activeTab === 'store' && (
        <DucksList mode="store" />
      )}
  </div>
);
}

export default App;
